@bostonmacosx You should use 

    var tempJSON: JSON = JSON(parseJSON: test1)

to construct a JSON object if you are parsing from string literal.

In your current Version the boolValue property returns false for String "1", which ist the most common string for bool. Why don't just use native boolValue of NSString? Or At least you should add "1" to your list. Here is my fix:

`
//Non-optional bool
    public var boolValue: Bool {
        get {
            switch self.type {
            case .bool:
                return self.rawBool
            case .number:
                return self.rawNumber.boolValue
            case .string:
                return (self.stringValue as? NSString)?.boolValue ?? false                
            default:
                return false
            }
        }
        set {
            self.object = newValue
        }
    }
`

This PR strengthens the tests around the JSON.rawData() function.

The https://github.com/IBM-Swift/SwiftyJSON fork has problems serializing nested json, it returns nil. 

The SwiftyJSON/SwiftyJSON has no problems serializing nested json. It works as it should.


I have added a unittest that hopefully can cause the problem to be fixed in the IBM-Swift/SwiftyJSON fork.


