	func asJson() -> JSON {
		let user: JSON = [
			"name": "John Doe"
		]
		return [
			"alarmLevel": 123,
			"user": user
		]
	}

	func main() {
		let json = asJson()
		let s = json.rawString() ?? "ERROR"
		print(s)
	}


